import com.eviware.soapui.support.XmlHolder

def holder=new XmlHolder(messageExchange.responseContentAsXml)

def name=holder.getNodeValue("//*:name")

def id=holder.getNodeValue("//*:id")

def sku=holder.getNodeValue("//*:sku")

context.getTestCase().setPropertyValue("name",name)

context.getTestCase().setPropertyValue("id",id)

context.getTestCase().getTestSuite().setPropertyValue("Sku", sku)

import com.eviware.soapui.support.XmlHolder 

def holder = new XmlHolder( messageExchange.responseContentAsXml) 

assert holder.getNodeValue("//*:sku") != null

con:config.script:
import com.eviware.soapui.model.testsuite.TestRunner.Status

//Get Test case for running
def TC=testRunner.testCase.testSuite.project.testSuites["Assignment 1_PropertyExpansion"].testCases["Add List View Delete Product"]

//run the test
def runner=TC.run(null,false)

//Show the status of test case results
log.info "Status: $runner.status, time taken For Testcase to run was:$runner.timeTaken ms"
log.info "Number of Test Steps ran:" +runner.results.size()

//assert that Test case has not failed
assert runner.status!=Status.FAILED:runner.reason

//assert test steps ran is 6
assert runner.results.size()==6
